o_filtered_categories\";s:4:\"2,37\";s:23:\"portfolio_content_width\";i:700;s:25:\"portfolio_portfolio_width\";i:1260;s:19:\"portfolio_show_tags\";b:1;s:33:\"portfolio_whole_overlay_clickable\";b:1;s:26:\"portfolio_post_show_social\";b:1;}','yes'),(19800,'theme_mods_risewp','a:1:{s:18:\"custom_css_post_id\";i:-1;}','yes'),(19801,'_transient_risewp_categories','2','yes'),(19844,'theme_mods_photo-magic','a:1:{s:18:\"custom_css_post_id\";i:-1;}','yes'),(19846,'_transient_photo_magic_categories','2','yes'),(19892,'theme_switch_menu_locations','a:1:{s:7:\"primary\";i:7;}','yes'),(19894,'customize_stashed_theme_mods','a:0:{}','no'),(19927,'_transient_timeout_oembed_2a7f4032b001df09cc9a52c1412dd092','1542545715','no'),(19928,'_transient_oembed_2a7f4032b001df09cc9a52c1412dd092','O:8:\"stdClass\":21:{s:4:\"type\";s:5:\"video\";s:7:\"version\";s:3:\"1.0\";s:13:\"provider_name\";s:5:\"Vimeo\";s:12:\"provider_url\";s:18:\"https://vimeo.com/\";s:5:\"title\";s:12:\"The Mountain\";s:11:\"author_name\";s:15:\"TSO Photography\";s:10:\"author_url\";s:24:\"https://vimeo.com/terjes\";s:7:\"is_plus\";s:1:\"0\";s:12:\"account_type\";s:5:\"basic\";s:4:\"html\";s:184:\"<iframe src=\"https://player.vimeo.com/video/22439234?app_id=122963\" width=\"600\" height=\"338\" frameborder=\"0\" title=\"The Mountain\" allow=\"autoplay; fullscreen\" allowfullscreen></iframe>\";s:5:\"width\";i:600;s:6:\"height\";i:338;s:8:\"duration\";i:189;s:11:\"description\";s:1978:\"Follow on:\nhttps://facebook.com/TSOphotography for more photos, videos and updates. \n\nThis was filmed between 4th and 11th April 2011. I had the pleasure of visiting El Teide.\nSpain´s highest mountain  @(3718m) is one of the best places in the world to photograph the stars and is also the location of Teide Observatories, considered to be one of the world´s best observatories. \n\nThe goal was to capture the beautiful Milky Way galaxy along with one of the most amazing mountains I know El Teide. I have to say this was one of the most exhausting trips I have done. There was a lot of hiking at high altitudes and probably less than 10 hours of sleep in total for the whole week. Having been here 10-11 times before I had a long list of must-see locations I wanted to capture for this movie, but I am still not 100% used to carrying around so much gear required for time-lapse movies.\n \nA large sandstorm hit the Sahara Desert on the 9th April (http://bit.ly/g3tsDW) and at approx 3am in the night the sandstorm hit me, making  it nearly impossible to see the sky with my own eyes.\n\nInterestingly enough my camera was set for a 5 hour sequence of the milky way during this time and I was sure my whole scene was ruined. To my surprise, my camera had managed to capture the sandstorm which was backlit by Grand Canary Island making it look like golden clouds. The Milky Way was shining through the clouds, making the stars sparkle in an interesting way. So if you ever wondered how the Milky Way would look through a Sahara sandstorm, look at 00:32.\n\nAvailable in Digital Cinema 4k.\n\nFollow Facebook: http://www.facebook.com/TSOPhotography\nFollow Twitter:\nhttp://twitter.com/TSOPhotography\nFollow Google+:\nhttps://plus.google.com/107543460658107759808\n\nPress/licensing/projects contact: tsophotography@gmail.com\n\n\nMusic by my friend: Ludovico Einaudi - \"Nuvole bianche\" with permission. \nPlease support the artist here:\nhttp://itunes.apple.com/us/album/una-mattina/id217799399\";s:13:\"thumbnail_url\";s:50:\"https://i.vimeocdn.com/video/145026168_295x166.jpg\";s:15:\"thumbnail_width\";i:295;s:16:\"thumbnail_height\";i:166;s:30:\"thumbnail_url_with_play_button\";s:168:\"https://i.vimeocdn.com/filter/overlay?src0=https%3A%2F%2Fi.vimeocdn.com%2Fvideo%2F145026168_295x166.jpg&src1=http%3A%2F%2Ff.vimeocdn.com%2Fp%2Fimages%2Fcrawler_play.png\";s:11:\"upload_date\";s:19:\"2011-04-15 08:35:35\";s:8:\"video_id\";i:22439234;s:3:\"uri\";s:16:\"/videos/22439234\";}','no'),(19934,'_site_transient_update_plugins','O:8:\"