<li>List item three</li>\r\n	<li>List item four</li>\r\n</ol>\r\n</li>\r\n	<li>List item two</li>\r\n	<li>List item three</li>\r\n	<li>List item four</li>\r\n</ol>\r\n<h2>HTML Tags</h2>\r\nThese supported tags come from the WordPress.com code <a title=\"Code\" href=\"http://en.support.wordpress.com/code/\">FAQ</a>.\r\n\r\n<strong>Address Tag</strong>\r\n\r\n<address>1 Infinite Loop\r\n\r\nCupertino, CA 95014\r\n\r\nUnited States</address><strong>Anchor Tag (aka. Link)</strong>\r\n\r\nThis is an example of a <a title=\"Apple\" href=\"http://apple.com\">link</a>.\r\n\r\n<strong>Abbreviation Tag</strong>\r\n\r\nThe abbreviation <abbr title=\"Seriously\">srsly</abbr> stands for “seriously”.\r\n\r\n<strong>Acronym Tag</strong>\r\n\r\nThe acronym <acronym title=\"For The Win\">ftw</acronym> stands for “for the win”.\r\n\r\n<strong>Big Tag</strong>\r\n\r\nThese tests are a <big>big</big> deal, but this tag is no longer supported in HTML5.\r\n\r\n<strong>Cite Tag</strong>\r\n\r\n“Code is poetry.” –<cite>Automattic</cite>\r\n\r\n<strong>Code Tag</strong>\r\n\r\nYou will learn later on in these tests that <code>word-wrap: break-word;</code> will be your best friend.\r\n\r\n<strong>Delete Tag</strong>\r\n\r\nThis tag will let you <del>strikeout text</del>, but this tag is no longer supported in HTML5 (use the <code>&lt;strike&gt;</code> instead).\r\n\r\n<strong>Emphasize Tag</strong>\r\n\r\nThe emphasize tag should <em>italicize</em> text.\r\n\r\n<strong>Insert Tag</strong>\r\n\r\nThis tag should denote <ins>inserted</ins> text.\r\n\r\n<strong>Keyboard Tag</strong>\r\n\r\nThis scarsly known tag emulates <kbd>keyboard text</kbd>, which is usually styled like the <code>&lt;code&gt;</code> tag.\r\n\r\n<strong>Preformatted Tag</strong>\r\n\r\nThis tag styles large blocks of code.\r\n<pre>.post-title {\r\n	margin: 0 0 5px;\r\n	font-weight: bold;\r\n	font-size: 38px;\r\n	line-height: 1.2;\r\n}</pre>\r\n<strong>Quote Tag</strong>\r\n\r\n<q>Developers, developers, developers…</q> –Steve Ballmer\r\n\r\n<strong>Strong Tag</strong>\r\n\r\nThis tag shows <strong>bold<strong> text.</strong></strong>\r\n\r\n<strong>Subscript Tag</strong>\r\n\r\nGetting our science styling on with H<sub>2</sub>O, which should push the “2″ down.\r\n\r\n<strong>Superscript Tag</strong>\r\n\r\nStill sticking with science and Isaac Newton’s E = MC<sup>2</sup>, which should lift the 2 up.\r\n\r\n<strong>Teletype Tag</strong>\r\n\r\nThis rarely used tag emulates <tt>teletype text</tt>, which is usually styled like the <code>&lt;code&gt;</code> tag.\r\n\r\n<strong>Variable Tag</strong>\r\n\r\nThis allows you to denote <var>variables</var>.','Typography','','inherit','open','open','','35-revision-v1','','','2014-08-20 09:10:48','2014-08-20 09:10:48','',35,'http://localhost/mysite/?p=69',0,'revision','',0),(70,1,'2014-09-08 10:18:27','2014-09-08 10:18:27','[gallery columns=\"4\" ids=\"64,60,59,58,57,56,55,54\"]','Gallery Post','','trash','open','open','','gallery-post__trashed','','','2018-11-17 13:42:07','2018-11-17 13:42:07','',0,'http://localhost/mysite/?p=70',0,'post','',0),(71,1,'2014-09-08 10:18:27','2014-09-08 10:18:27','[gallery columns=\"4\" ids=\"64,60,59,58,57,56,55,54\"]','Gallery Post','','inherit','open','open','','70-revision-v1','','','2014-09-08 10:18:27','2014-09-08 10:18:27','',70,'http://localhost/mysite/?p=71',0,'revision','',0),(72,1,'2014-09-08 10:19:02','2014-09-08 10:19:02','[caption id=\"attachment_64\" align=\"aligncenter\" width=\"1000\"]<a href=\"http://localhost/mysite/?attachment_id=64\" rel=\"attachment wp-att-64\"><img class=\"size-full wp-image-64\" src=\"http://localhost/mysite/wp-content/uploads/2014/08/5.jpg\" alt=\"Lorem ipsum dolor\" width=\"1000\" height=\"704\" /></a> Lorem ipsum dolor[/caption]','Image Post','','trash','open','open','','image-post__trashed','','','2018-11-17 13:42:07','2018-11-17 13:42:07','',0,'http://localhost/mysite/?p=72',0,'post','',0),(73,1,'2014-09-08 10:19:02','2014-09-08 10:19:02','[caption id=\"attachment_64\"