),(147,1,'2018-11-16 08:50:45','2018-11-16 08:50:45','Experienced Computer Science Teacher with significant achievements while working in the secondary education. Excelled in creating digital learning materials and innovative cross-curriculum pedagogical approaches and methods. Certified Microsoft Innovative Expert Educator. Lifelong learner.\n\nEnthusiastic, creative and willing to learn person as I am, now I\'m ready and looking for more creative and challenging new job where skills, knowledge and expertise gained throughout previous experience can be transferred and utilized.\n<blockquote>I’m particularly interested in working in Web Development because of my passion for creating beautiful things and dealing with challenging problem solving tasks.</blockquote>\nI have refreshed my knowledge about web development technologies and frameworks and gained a lot of new while my 6 months tech course in front-end development. I also got deep insight in UX/UI design. Now I\'m skilled in creating fully functional responsive websites, UI prototyping and UX research. I have experience in building and managing CMS sites in Wordpress and Joomla. I’m skilled in creating various digital materials using graphic design software like Adobe Photoshop and CorelDRAW.','About Me','','inherit','closed','closed','','32-revision-v1','','','2018-11-16 08:50:45','2018-11-16 08:50:45','',32,'http://localhost/mysite/?p=147',0,'revision','',0),(145,1,'2018-11-16 08:42:20','2018-11-16 08:42:20','Hello, I\'m Biljana.&nbsp;Experienced Computer Science Teacher with significant achievements while working in the secondary education. Excelled in creating digital learning materials and innovative cross-curriculum pedagogical approaches and methods. Certified Microsoft Innovative Expert Educator. Lifelong learner.\n\nWith over 12 year’s experience in education, I feel that I have achieved all that I can in my current job position. Integrated technology into learning with tablets and different tools, communication platforms and pedagogical approaches. Established a cross-curricular projects that resulted in 50+ students a year joining and producing various digital learning outcomes: digital notebooks, audio and video materials, sketches, programming 3D games. Mentoring students and other teachers on different projects and competitions. Coordinated Microsoft and Erasmus+ projects. Achieved Microsoft Innovative Expert Educator Certificate.\n\n&nbsp;\n\nEnthusiastic, creative and willing to learn person as I am, now I\'m ready and looking for more creative and challenging new job where skills, knowledge and expertise gained throughout previous experience can be transferred and utilized.&nbsp;\n\nI’m particularly interested in working in Web Development because of my passion for creating beautiful things and dealing with challenging problem solving tasks.\n<blockquote>UI/UX Designer with a passion for designing beautiful and functional experiences&nbsp;</blockquote>\n<blockquote>I’m particularly interested in working in Web Development because of my passion for creating beautiful things and dealing with challenging problem solving tasks.</blockquote>\nI have refreshed my knowledge about web development technologies and frameworks and gained a lot of new while my 6 months tech course in front-end development. I also got deep insight in UX/UI design. Now I\'m skilled in creating fully functional responsive websites, UI prototyping and UX research. I have experience in building and managing CMS sites in Wordpress and Joomla. I’m skilled in creating various digital materials using graphic design software like Adobe Photoshop and CorelDRAW.','About Me','','inherit','closed','closed','','32-revision-v1','','','2018-11-16 08:42:20','2018-11-16 08:42:20','',32,'http://localhost/mysite/?p=145',0,'revision','',0),(149,1,'2018-11-16 09:04:22','2018-11-16 09:04:22','','brainsterbox','','inherit','open','closed','','brainsterbox','','','2018-11-16 09:04:22','2018-11-16 09:04:22','