/localhost/mysite/wp-content/uploads/2018/11/s.png\" alt=\"\" class=\"wp-image-273\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>\n\nAt the bottom of the page 4 random selected cards are shown.\n\n</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":269} -->\n<figure class=\"wp-block-image\"><img src=\"http://localhost/mysite/wp-content/uploads/2018/11/stuffpicks.png\" alt=\"\" class=\"wp-image-269\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>&nbsp;I used&nbsp;<a href=\"https://disqus.com/\">Disqus</a> comment plug-in to allow users to comment and discuss.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":270} -->\n<figure class=\"wp-block-image\"><img src=\"http://localhost/mysite/wp-content/uploads/2018/11/dis.png\" alt=\"\" class=\"wp-image-270\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>To see demo site, follow this&nbsp;<a href=\"http://bkumpa.eu5.org/myfiles2/index.html\">&nbsp;link.</a></p><p>All source files on gitLab</p></blockquote>\n<!-- /wp:quote -->','Brainster Box','','inherit','closed','closed','','103-revision-v1','','','2018-11-17 16:01:59','2018-11-17 16:01:59','',103,'http://localhost/mysite/?p=365',0,'revision','',0),(347,1,'2018-11-17 15:16:57','2018-11-17 15:16:57','<p>Simulation of chat application. You can have a chat with some contact from a list. You can type messages and will receive random message as an answer. You can edit sent messages. One conversation at a time.</p>\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":185} -->\n<figure class=\"wp-block-image\"><img src=\"http://localhost/mysite/wp-content/uploads/2018/11/chat-thumb1.jpg\" alt=\"\" class=\"wp-image-185\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:block {\"ref\":344} /-->\n\n<!-- wp:paragraph -->\n<p>Added functionality with jQuery.<br></p>\n<!-- /wp:paragraph -->','ChatApp - demo','','inherit','closed','closed','','97-revision-v1','','','2018-11-17 15:16:57','2018-11-17 15:16:57','',97,'http://localhost/mysite/?p=347',0,'revision','',0),(348,1,'2018-11-17 15:17:04','2018-11-17 15:17:04','<p>Simulation of chat application. You can have a chat with some contact from a list. You can type messages and will receive random message as an answer. You can edit sent messages. One conversation at a time.</p>\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Added functionality with jQuery.<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":185} -->\n<figure class=\"wp-block-image\"><img src=\"http://localhost/mysite/wp-content/uploads/2018/11/chat-thumb1.jpg\" alt=\"\" class=\"wp-image-185\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:block {\"ref\":344} /-->','ChatApp - demo','','inherit','closed','closed','','97-revision-v1','','','2018-11-17 15:17:04','2018-11-17 15:17:04','',97,'http://localhost/mysite/?p=348',0,'revision','',0),(356,1,'2018-11-17 15:31:21','2018-11-17 15:31:21','<p>One page commercial web site.  <br />FrontEnd Academy exercise.</p>\n\n<!-- wp:image {\"id\":352} -->\n<figure class=\"wp-block-image\"><img src=\"http://localhost/mysite/wp-content/uploads/2014/09/ecom2-1024x635.jpg\" alt=\"\" class=\"wp-image-352\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:block {\"ref\":344} /-->','Proffesional Gardening Care','','inherit','closed','closed','','95-revision-v1','','','2018-11-17 15:31:21','2018-11-17 15:31:21','',95,'http://localhost/mysite/?p=356',0,'revision','',0),(354,1,'2018-11-17 15:29:49','2018-11-17 15:29:49','<p>One page commercial web site. <br />FrontEnd Academy exercise.</p>\n\n<!-- wp:gallery -->\n<ul class=\"wp-block-gallery columns-3 is-cropped\"><li class=\"blocks-gallery-item\"><figure><img src=\"http://localhost/mysite/wp-content/uploads/2018/11/ecom-1024x519.jpg\" alt=\"\" data-id=\"350\" data-link=\"http://localhost/mysite/?attachment_id=350\" class=\"wp-image-350\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"http://localhos